import React from 'react';
import { withRouter } from 'react-router-dom';
import { Authentication } from '../common/AuthenticationContext';

const ProfileCard = (props: any) => {


    return (
        <Authentication.Consumer>
            {
                (value:any) => {
                    let message = "YOU CONNOT EDIT";
                    const userPath: string = props.match.params.username;

                    if (userPath === value.username) {
                        message = "YOU CAN EDIT";
                    }

                    return (
                        <div>
                            {message}
                        </div>
                    );
                }
            }

        </Authentication.Consumer>
    )



};

export default withRouter(ProfileCard);
